    "straiten" : "1. To make strait; to make narrow; hence, to contract; to confine. Waters, when straitened, as at the falls of bridges, give a roaring noise. Bacon. In narrow circuit, straitened by a foe. Milton. 2. To make tense, or tight; to tighten. They straiten at each end the cord. Pope. 3. To restrict; to distress or embarrass in respect of means or conditions of life; -- used chiefly in the past participle; -- as, a man straitened in his circumstances.",
