    "clearcole" : "A priming of size mixed with whiting or white lead, used in house painting, etc.; also, a size upon which gold leaf is applied in gilding.\n\nTo coat or paint with clearcole.",
    "abreast" : "1. Side by side, with breasts in a line; as, \"Two men could hardly walk abreast.\" Macaulay. 2. (Naut.)  Side by side; also, opposite; over against; on a line with the vessel's beam; -- with of. 3. Up to a certain level or line; equally advanced; as, to keep abreast of [or with] the present state of science. 4. At the same time; simultaneously. [Obs.] Abreast therewith began a convocation. Fuller.",
    "acrostical" : "Pertaining to, or characterized by, acrostics.",
    "parenetioal" : "Hortatory; encouraging; persuasive. [R.] F. Potter.",
    "fulahs" : ", Foo\"lahs` (, n. pl.; sing. Fulah, Foolan (. (Ethnol.) A peculiar African race of uncertain origin, but distinct from the negro tribes, inhabiting an extensive region of Western Soudan. Their color is brown or yellowish bronze. They are Mohammedans. Called also Fellatahs, Foulahs, and Fellani. Fulah is also used adjectively; as, Fulah empire, tribes, language.",
    "unjointed" : "1. Disjointed; unconnected; hence, incoherent. Shak. 2. Etym: [Pref. un- + jointed.]  Having no joint or articulation; as, an unjointed stem.",
    "shagreen" : "To chagrin. [Obs.]\n\n1. A kind of untanned leather prepared in Russia and the East, from the skins of horses, asses, and camels, and grained so as to be covered with small round granulations. This characteristic surface is produced by pressing small seeds into the grain or hair side when moist, and afterward, when dry, scraping off the roughness left between them, and then, by soaking, causing the portions of the skin which had been compressed or indented by the seeds to swell up into relief. It is used for covering small cases and boxes. 2. The skin of various small sharks and other fishes when having small, rough, bony scales. The dogfishes of the genus Scyllium furnish a large part of that used in the arts.\n\n1. Made or covered with the leather called shagreen. \"A shagreen case of lancets.\" T. Hook. 2. (Zoöl.)  Covered with rough scales or points like those on shagreen.",
    "countermure" : "A wall raised behind another, to supply its place when breached or destroyed. [R.] Cf. Contramure. Knolles.\n\nTo fortify with a wall behind another wall. [R.] Kyd.",
    "diffusate" : "Material which, in the process of catalysis, has diffused or passed through the separating membrane.",
    "emphasis" : "1. (Rhet.)  A particular stress of utterance, or force of voice, given in reading and speaking to one or more words whose signification the speaker intends to impress specially upon his audience. The province of emphasis is so much more important than accent, that the customary seat of the latter is changed, when the claims of emphasis require it. E. Porter. 2. A peculiar impressiveness of expression or weight of thought; vivid representation, enforcing assent; as, to dwell on a subject with great emphasis. External objects stand before us . . . in all the life and emphasis of extension, figure, and color. Sir W. Hamilton.",
    "lententide" : "The season of Lenten or Lent.",
