    "catachresis" : "A figure by which one word is wrongly put for another, or by which a word is wrested from its true signification; as, \"To take arms against a sea of troubles. \" Shak. \"Her voice was but the shadow of a sound.\" Young.",
    "enfouldred" : "Mixed with, or emitting, lightning. [Obs.] \"With foul enfouldred smoke.\" Spenser.",
    "coquille" : "(a) A shell or shell-like dish or mold in which viands are served. (b) The expansion of the guard of a sword, dagger, etc. (c) A form of ruching used as a dress trimming or for neckwear, and named from the manner in which it is gathered or fulled. [Webster 1913 Suppl.]",
    "reduplicate" : "1. Double; doubled; reduplicative; repeated. 2. (Bot.)  Valvate with the margins curved outwardly; -- said of the\n\n1. To redouble; to multiply; to repeat. 2. (Gram.)  To repeat the first letter or letters of (a word). See Reduplication,3.",
    "rugate" : "Having alternate ridges and depressions; wrinkled. Dana.",
    "centerboard" : "A movable or sliding keel formed of a broad board or slab of wood or metal which may be raised into a water-tight case amidships, when in shallow water, or may be lowered to increase the area of lateral resistance and prevent leeway when the vessel is beating to windward. It is used in vessels of all sizes along the coast of the United States",
    "conjunctive" : "1. Serving to unite; connecting together. 2. Closely united. [Obs.] Shak. Conjunctive mood (Gram.), the mood which follows a conjunction or expresses contingency; the subjunctive mood. -- Conjunctive tissue (Anat.), the tissue found in nearly all parts of most animals. It yields gelatin on boiling, and consists of vriously arranged fibers which are imbedded protoplasmic cells, or corpuscles; -- called also cellular tissue and connective tissue. Adipose or fatty tissue is one of its many forms, and cartilage and bone are sometimes included by the phrase.",
