    "sodomy" : "Carnal copulation in a manner against nature; buggery. Gen. xix. 5.",
    "flagrant" : "1. Flaming; inflamed; glowing; burning; ardent. The beadle's lash still flagrant on their back. Prior. A young man yet flagrant from the lash of the executioner or the beadle. De Quincey. Flagrant desires and affections. Hooker. 2. Actually in preparation, execution, or performance; carried on hotly; raging. A war the most powerful of the native tribes was flagrant. Palfrey. 3. Flaming into notice; notorious; enormous; heinous; glaringly wicked. Syn. -- Atrocious; flagitious; glaring. See Atrocious.",
    "agaty" : "Of the nature of agate, or containing agate.",
    "sors" : "A lot; also, a kind of divination by means of lots. Sortes Homericæ or Virgilianæ Etym: [L., Homeric or Virgilian lots], a form of divination anciently practiced, which consisted in taking the first passage on which the eye fell, upon opening a volume of Homer or Virgil, or a passage drawn from an urn which several were deposited, as indicating future events, or the proper course to be pursued. In later times the Bible was used for the same purpose by Christians.",
