    "toned" : "Having (such) a tone; -- chiefly used in composition; as, high- toned; sweet-toned. Toned paper, paper having a slight tint, in distinction from paper which is quite white.",
    "lithographical" : "Of or pertaining to lithography; made by lithography; as, the lithographic art; a lithographic picture. Lithographic limestone (Min.), a compact, fine-grained limestone, obtained largely from the Lias and Oölite, esp. of Bavaria, and extensively used in lithography. -- Lith`o*graph\"ic*al*ly, adv.",
