    "obstacle" : "That which stands in the way, or opposes; anything that hinders progress; a hindrance; an obstruction, physical or moral. If all obstacles were cut away. And that my path were even to the crown. Shak. Syn. -- Impediment; obstuction; hindrance; difficulty. See Impediment, and Obstruction.",
    "hypercarbureted" : "Having an excessive proportion of carbonic acid; -- said of bicarbonates or acid carbonates. [Written also hypercarburetted.]",
    "sturt" : "To vex; to annoy; to startle. [Obs. or Prov. Eng. & Scot.]\n\n1. Disturbance; annoyance; care. [Obs. or Prov. Eng. & Scot.] \"Sturt and care.\" J. Rolland. 2. (Mining)  A bargain in tribute mining by which the tributor profits. Raymond.",
    "guiltless" : "1. Free from guilt; innocent. The Lord will not hold him guiltless that taketh his name in vain. Ex. xx. 7. 2. Without experience or trial; unacquainted (with). Such gardening tools, as art, yet rude, Guiltless of fire, had formed. Milton. -- Guilt\"less*ly, adv. -- Guilt\"less*ness, n.",
