    "cottise" : "A diminutive of the bendlet, containing one half its area or one quarter the area of the bend. When a single cottise is used alone it is often called a cost. See also Couple-close.",
    "markee" : "See Marquee.",
    "achievement" : "1. The act of achieving or performing; an obtaining by exertion; successful performance; accomplishment; as, the achievement of his object. 2. A great or heroic deed; something accomplished by valor, boldness, or praiseworthy exertion; a feat. [The exploits] of the ancient saints . . . do far surpass the most famous achievements of pagan heroes. Barrow. The highest achievements of the human intellect. Macaulay. 3. (Her.)  An escutcheon or ensign armorial; now generally applied to the funeral shield commonly called hatchment. Cussans.",
    "parousia" : "(a) The nativity of our Lord. (b) The last day. Shipley.",
    "buttons" : "A boy servant, or page, -- in allusion to the buttons on his livry. [Colloq.] Dickens.",
    "buskined" : "1. Wearing buskins. Her buskined virgins traced the dewy lawn. Pope. 2. Trodden by buskins; pertaining to tragedy. \"The buskined stage.\" Milton.",
    "misseek" : "To seek for wrongly. [Obs.]",
    "conversational" : "Pertaining to conversation; in the manner of one conversing; as, a conversational style. Thackeray.",
    "preponderate" : "1. To outweigh; to overpower by weight; to exceed in weight; to overbalance. An inconsiderable weight, by distance from the center of the balance, will preponderate greater magnitudes. Glanvill. 2. To overpower by stronger or moral power. 3. To cause to prefer; to incline; to decide. [Obs.] The desire to spare Christian blood preponderates him for peace. Fuller.\n\nTo exceed in weight; hence, to incline or descend, as the scale of a balance; figuratively, to exceed in influence, power, etc.; hence; to incline to one side; as, the affirmative side preponderated. That is no just balance in which the heaviest side will not preponderate. Bp. Wilkins.",
    "committer" : "1. One who commits; one who does or perpetrates. South. 2. A fornicator. [Obs.] T. Decker.",
    "allenarly" : "Solely; only. [Scot.] Sir W. Scott.",
    "deuce" : "1. (Gaming)  Two; a card or a die with two spots; as, the deuce of hearts. 2. (Tennis)  A condition of the score beginning whendeuce, which decides the game.\n\nThe devil; a demon. [A euphemism, written also deuse.] [Low]",
    "quarter round" : "An ovolo.",
    "ambon" : "Same as Ambo.",
    "transposition" : "The act of transposing, or the state of being transposed. Specifically: --(a) (Alg.)  The bringing of any term of an equation from one side over to the other without destroying the equation. (b) (Gram.) A change of the natural order of words in a sentence; as, the Latin and Greek languages admit transposition, without inconvenience, to a much greater extent than the English. (c) (Mus.) A change of a composition into another key.",
    "mangonize" : "To furbish up for sale; to set off to advantage. [Obs. or R.] B. Jonson.",
    "cholerine" : "(a) The precursory symptoms of cholera. (b) The first stage of epidemic cholera. (c) A mild form of cholera.",
    "half-decked" : "Partially decked. The half-decked craft . . . used by the latter Vikings. Elton.",
    "causation" : "The act of causing; also the act or agency by which an effect is produced. The kind of causation by which vision is produced. Whewell. Law of universal causation, the theoretical or asserted law that every event or phenomenon results from, or is the sequel of, some previous event or phenomenon, which being present, the other is certain to take place.",
