    "oxaluramide" : "Same as Oxalan.",
    "pursuivant" : "1. (Heralds' College)  A functionary of lower rank than a herald, but discharging similar duties; -- called also pursuivant at arms; an attendant of the heralds. Also used figuratively. The herald Hope, forerunning Fear, And Fear, the pursuivant of Hope. Longfellow. 2. The king's messenger; a state messenger. One pursuivant who attempted to execute a warrant there was murdered. Macaulay.\n\nTo pursue. [Obs. & R.] Their navy was pursuivanted after with a horrible tempest. Fuller.",
