    "tegmen" : "1. A tegument or covering. 2. (Bot.)  The inner layer of the coating of a seed, usually thin and delicate; the endopleura. 3. (Zoöl.)  One of the elytra of an insect, especially of certain Orthoptera. 4. pl. (Zoöl.)  Same as Tectrices.",
