    "savorless" : "Having no savor; destitute of smell or of taste; insipid.",
    "effluviate" : "To give forth effluvium. [R.] \"An effluviating power.\" Boyle.",
    "tout" : "1. To act as a tout. See 2d Tout. [Cant. Eng.] 2. To ply or seek for customers. [Prov. Eng.]\n\nOne who secretly watches race horses which are in course of training, to get information about their capabilities, for use in betting. [Cant. Eng.]\n\nTo toot a horn.\n\nThe anus. [Obs.] Chaucer.",
    "cubeb" : "The small, spicy berry of a species of pepper (Piper Cubeba; in med., Cubeba officinalis), native in Java and Borneo, but now cultivated in various tropical countries. The dried unripe fruit is much used in medicine as a stimulant and purgative.",
    "scomm" : "1. A bufoon. [Obs.] L'Estrange. 2. A flout; a jeer; a gibe; a taunt. [Obs.] Fortherby.",
